function [ DGprediction,speedmaxF,residuals,LHS,RHS,Jac_east_cell,Jac_west_cell, ...
        Jac_east_other,Jac_west_other, ...
        Jac_trunc_east,Jac_trunc_west, ...
        Jac_cell, ...
        trunc_east,trunc_west, ...
        flux_east, flux_west, ...
        residual_cell] = problem_NewtonIteration_1D_RI1DG(DGprev,DGpast,data,residuals)
%UNTITLED2 Summary of this function goes here
%   Detailed explanation goes here

%h1 = waitbar(0,'Predicting...','OuterPosition', [100 100 300 75]);

%See predictor_main_parfor

%DGprev = problem_boundaryconditions_psi(DGprevious_psi,data);

Nv1 = data.Nv1;
thetaT = data.thetaT;

residual_cell = zeros(thetaT,Nv1);%residual_cell;    
trunc_east = zeros(thetaT,Nv1);%truncE;
trunc_west = zeros(thetaT,Nv1);%truncW;
Jac_trunc_east = zeros(thetaT,thetaT,Nv1);%Jac_trunc_east;   
Jac_trunc_west = zeros(thetaT,thetaT,Nv1);%Jac_trunc_west;    
Jac_cell = zeros(thetaT,thetaT,Nv1);%Jac_cell;  
Jac_east_cell = zeros(thetaT,thetaT,Nv1);%Jac_east;
Jac_west_cell = zeros(thetaT,thetaT,Nv1);%Jac_west;
Jac_east_other = zeros(thetaT,thetaT,Nv1);%Jac_east;
Jac_west_other = zeros(thetaT,thetaT,Nv1);%Jac_west;
flux_east = zeros(thetaT,Nv1);%fluxeast; 
flux_west = zeros(thetaT,Nv1);%fluxwest;


[DGprev_east,DGprev_west] = problem_boundaryconditions_psi(DGprev,data);

DGprediction = DGprev;%aN(thetaT,data.Nv1);

speedmaxF = 0;

needs_iteration = residuals > data.residTol;

needs_numerical = [needs_iteration needs_iteration(1)];
needs_numerical = needs_numerical + [needs_iteration(end) needs_iteration ];

needs_trunc_left = needs_numerical + circshift(needs_numerical,1,2);
needs_trunc_rite = needs_numerical + circshift(needs_numerical,-1,2);

needs_flux_information = needs_trunc_left + needs_trunc_rite;

%Psi_futr = data.Psi_futr;
%I_past = data.I_past;
thetaTtilde = thetaT/data.Neqns;
gamma = data.appdata.gamma;
gm1 = gamma-1;
gm3 = gm1-2;
vectpsi_east = data.vectpsi_east;
vectpsi_east_Trans = data.vectpsi_east_Trans;
vectpsi_west = data.vectpsi_west;
vectpsi_west_Trans = data.vectpsi_west_Trans;
vectpsi = data.vectpsi;
vectpsi_dxii_Trans = data.vectpsi_dxii_Trans;
nuv1 = data.nuv1;
Neqns = data.Neqns;
Pd = data.Pd;
Pdp1 = data.Pdp1;
Dlist = data.Dlist;
Dp1list = data.Dp1list;
Dquadwgts = data.Dquadwgts;
Dp1quadwgts = data.Dp1quadwgts;
r_param = data.r_param;

vectpsi_single = vectpsi(1,1:thetaTtilde,:,:);

Nv1 = data.Nv1;
periodic = @(i) mod(i - 1,Nv1)+1;

needs_flux_information(end) = [];

for if1 = find(needs_flux_information>0)%1:(Nv1)    
    
    iv1_left = periodic(if1-1);
    iv1_rite = periodic(if1);

    Jac_left_cross = 0;            
    Jac_rite_cross = 0;
    Jac_speed = 0;
    trunc_east_cross = 0;
    trunc_west_cross = 0;
    for k = 1:Pd
        tquad = Dlist(k,1); 
        weight = Dquadwgts(k);        
        if needs_trunc_left(if1) > 1
            wleft(:,tquad) = vectpsi_east(:,:,tquad)*DGprev(:,iv1_left);
            rho = wleft(1,tquad);
            m = wleft(2,tquad);
            E = wleft(3,tquad);

            orho = 1/rho;
            u = m*orho;
            u2 = u*u;
            u3 = u2*u;
            p = gm1*(E - rho*u2*0.5);
            h = u*(E+p);
            c = sqrt(gamma*p*orho);

            JF_left(3,3) = gamma*u ;
            JF_left(3,2) = gamma*E*orho - gm1*1.5*u2   ;
            JF_left(3,1) = -gamma*u*E*orho + gm1*u3 ;
            JF_left(2,3) = gm1;
            JF_left(2,2) = -gm3*u;
            JF_left(2,1) = gm3*u2*0.5;
            JF_left(1,2) = 1;

            F_left(3,1) = h ;
            F_left(2,1) = m*u + p  ;
            F_left(1,1) = m ;

            speedF_left(tquad) = abs(u)+c;

            dcdq = gamma*gm1*0.5/c*orho*[-E*orho-rho*u2 m 1];
            dspeeddq_left = [abs(u) sign(u) 0]*orho + dcdq;   
                        
            trunc_east_term =  (nuv1*weight)*(vectpsi_east_Trans(:,:,tquad)*F_left);
            trunc_east(:,iv1_left) = trunc_east(:,iv1_left) + trunc_east_term;
            trunc_east_cross = - (nuv1*weight)*(vectpsi_west_Trans(:,:,tquad)*F_left);
            
            Jac_qleft = JF_left*vectpsi_east(:,:,tquad).*(weight*nuv1);
            Jac_trunc_east(:,:,iv1_left) = Jac_trunc_east(:,:,iv1_left) + vectpsi_east_Trans(:,:,tquad)*Jac_qleft;            
        end
        
        if needs_trunc_rite(if1) > 1
            write(:,tquad) = vectpsi_west(:,:,tquad)*DGprev(:,iv1_rite);
            rho = write(1,tquad);
            m = write(2,tquad);
            E = write(3,tquad);

            orho = 1/rho;
            u = m*orho;
            u2 = u*u;
            u3 = u2*u;
            p = gm1*(E - rho*u2*0.5);
            h = u*(E+p);
            c = sqrt(gamma*p*orho);

            JF_rite(3,3) = gamma*u ;
            JF_rite(3,2) = gamma*E*orho - gm1*1.5*u2   ;
            JF_rite(3,1) = -gamma*u*E*orho + gm1*u3 ;
            JF_rite(2,3) = gm1;
            JF_rite(2,2) = -gm3*u;
            JF_rite(2,1) = gm3*u2*0.5;
            JF_rite(1,2) = 1;

            F_rite(3,1) = h ;
            F_rite(2,1) = m*u + p  ;
            F_rite(1,1) = m ;

            speedF_rite(tquad) = abs(u)+c;
                       
            dcdq = gamma*gm1*0.5/c*orho*[-E*orho-rho*u2 m 1];
            dspeeddq_rite = [abs(u) sign(u) 0]*orho + dcdq;               
            
            trunc_west_term =  - (nuv1*weight)*(vectpsi_west_Trans(:,:,tquad)*F_rite);
            trunc_west(:,iv1_rite) = trunc_west(:,iv1_rite) + trunc_west_term;
            trunc_west_cross = (nuv1*weight)*(vectpsi_east_Trans(:,:,tquad)*F_rite);
            
            Jac_qrite = JF_rite*vectpsi_west(:,:,tquad).*(weight*nuv1);
            Jac_trunc_west(:,:,iv1_rite) = Jac_trunc_west(:,:,iv1_rite) - vectpsi_west_Trans(:,:,tquad)*Jac_qrite;
            
        end        
        
        if needs_numerical(if1) > 1
        
            wavg = (wleft(:,tquad)+write(:,tquad))*0.5;
            rho = wavg(1);
            m = wavg(2);
            E = wavg(3);
            orho = 1/rho;
            u = m*orho;
            u2 = u*u;
            p = gm1*(E - rho*u2*0.5);        
            c = sqrt(gamma*p*orho);                  
            speedF_avg(tquad) = abs(u)+c;
            
            dcdq = gamma*gm1*0.5/c*orho*[-E*orho-rho*u2 m 1];
            dspeeddq_avg = [abs(u) sign(u) 0]*orho + dcdq;               
            
            Jac_left_cross = Jac_left_cross + vectpsi_west_Trans(:,:,tquad)*Jac_qleft;            
            Jac_rite_cross = Jac_rite_cross + vectpsi_east_Trans(:,:,tquad)*Jac_qrite;
            
            [speedmax,which] = max([speedF_left(tquad) speedF_rite(tquad) speedF_avg(tquad)]);            
            switch which 
                case 1
                    dspeedmaxdq = dspeeddq_left;
                case 2
                    dspeedmaxdq = dspeeddq_avg;
                case 3
                    dspeedmaxdq = dspeeddq_rite;
            end
                
            flux_diff = write(:,tquad) - wleft(:,tquad);
            flux_speed(:,tquad) = speedmax*flux_diff;
            
            flux_east(:,iv1_left) = flux_east(:,iv1_left) + trunc_east_term*0.5 + trunc_west_cross*0.5 - vectpsi_east_Trans(:,:,tquad)*flux_speed(:,tquad)*0.5*(nuv1*weight);            
            flux_west(:,iv1_rite) = flux_west(:,iv1_rite) + trunc_west_term*0.5 + trunc_east_cross*0.5 + vectpsi_west_Trans(:,:,tquad)*flux_speed(:,tquad)*0.5*(nuv1*weight);
            
            speedterm_east = speedmax*vectpsi_east_Trans(:,:,tquad)*vectpsi_east(:,:,tquad)*(weight*nuv1);
            speedterm_west = speedmax*vectpsi_west_Trans(:,:,tquad)*vectpsi_east(:,:,tquad)*(weight*nuv1);
            speedterm_westwest = speedmax*vectpsi_west_Trans(:,:,tquad)*vectpsi_west(:,:,tquad)*(weight*nuv1);

            dspeeddqterm_east = vectpsi_east_Trans(:,:,tquad)*flux_diff*dspeedmaxdq*vectpsi_east(:,:,tquad)*(weight*nuv1);
            dspeeddqterm_west = vectpsi_west_Trans(:,:,tquad)*flux_diff*dspeedmaxdq*vectpsi_east(:,:,tquad)*(weight*nuv1);
            dspeeddqterm_westwest = vectpsi_west_Trans(:,:,tquad)*flux_diff*dspeedmaxdq*vectpsi_west(:,:,tquad)*(weight*nuv1);
            
            
            Jac_east_cell(:,:,iv1_left) = Jac_east_cell(:,:,iv1_left) + speedterm_east*0.5 + dspeeddqterm_east*0.5 + vectpsi_east_Trans(:,:,tquad)*Jac_qleft*0.5;
            Jac_east_other(:,:,iv1_left) = Jac_east_other(:,:,iv1_left) - speedterm_west'*0.5 - dspeeddqterm_west'*0.5 + vectpsi_east_Trans(:,:,tquad)*Jac_qrite*0.5;

            Jac_west_cell(:,:,iv1_rite) = Jac_west_cell(:,:,iv1_rite) + speedterm_westwest*0.5 + dspeeddqterm_westwest*0.5 - vectpsi_west_Trans(:,:,tquad)*Jac_qrite*0.5;
            Jac_west_other(:,:,iv1_rite) = Jac_west_other(:,:,iv1_rite) - speedterm_west*0.5 - dspeeddqterm_west*0.5 - vectpsi_west_Trans(:,:,tquad)*Jac_qleft.*0.5;  
        
        end        
    end
end


