solverdata.rx_param = data.rx_param;
solverdata.ry_param = data.ry_param;
solverdata.rz_param = data.rz_param;
for iv1 = find(needs_iteration)%
    qpastsolve = DGprev(:,iv1);   
    cellsi = 1+mod(iv1+deltar-1,Nv1);

    this.residual_cell = residual_cell(:,cellsi);
    this.trunc_west = trunc_west(:,cellsi);
    this.trunc_east = trunc_east(:,cellsi);
    this.flux_east = east_flux(:,cellsi);
    this.flux_west = flux_west(:,cellsi);
    this.Jac_cell = Jac_cell(:,:,cellsi);    
    this.Jac_east_cell = Jac_east_cell(:,:,cellsi); 
    this.Jac_west_cell = Jac_west_cell(:,:,cellsi); 
    this.Jac_east_other = Jac_east_other(:,:,cellsi); 
    this.Jac_west_other = Jac_west_other(:,:,cellsi); 
    this.Jac_trunc_east = Jac_trunc_east(:,:,cellsi);
    this.Jac_trunc_west = Jac_trunc_west(:,:,cellsi);
            
    [DGprediction_here,residuals_here] = predictor_solver(qpastsolve,this,solverdata);
    DGprediction(:,iv1) = DGprediction_here;
    %residuals(:,iv1) = max(abs(residuals_here));

end
%}

cellis = @(i,iv1) 1+mod(i-1,Nv1);
for iv1 = find(needs_iteration)
    switch data.r_param
        case 0            
            celli = cellis(iv1-0);
            residual_star = residual_cell(:,celli) + trunc_west(:,celli) + trunc_east(:,celli);
            J_Star_star = Jac_cell(:,:,celli) + Jac_trunc_east(:,:,celli) + Jac_trunc_west(:,:,celli);
               
            RHS = residual_star;
            LHS = J_Star_star;        
            DGprediction(:,iv1) = DGprev(:,iv1) - LHS\RHS;
            
        case 1
            celli = cellis(iv1-1);
            residual_west = residual_cell(:,celli) + trunc_west(:,celli) + flux_east(:,celli);
            J_West_star = Jac_cell(:,:,celli) + Jac_east_cell(:,:,celli)  + Jac_trunc_west(:,:,celli);
            J_West_rite = Jac_east_other(:,:,celli);

            celli = cellis(iv1-0);
            residual_star = residual_cell(:,celli) + flux_west(:,celli) + flux_east(:,celli);
            J_Star_left = Jac_west_other(:,:,celli);
            J_Star_star = Jac_cell(:,:,celli) + Jac_east_cell(:,:,celli) + Jac_west_cell(:,:,celli);
            J_Star_rite = Jac_east_other(:,:,celli);

            celli = cellis(iv1+1);
            residual_rite = residual_cell(:,celli) + flux_west(:,celli) + trunc_east(:,celli);

            J_East_left = Jac_west_other(:,:,celli);
            J_East_star = Jac_cell(:,:,celli)  + Jac_west_cell(:,:,celli) + Jac_trunc_east(:,:,celli);
               
            RHS(:,iv1) = residual_star - J_Star_left*(J_West_star\residual_west) - J_Star_rite*(J_East_star\residual_rite);
            LHS(:,:,iv1) = J_Star_star - J_Star_left*(J_West_star\J_West_rite) - J_Star_rite*(J_East_star\J_East_left);   
            DGprediction(:,iv1) = DGprev(:,iv1) - LHS(:,:,iv1)\RHS(:,iv1);
            
            residuals(iv1) = max(abs(residual_star));
    end
end

